          <Route exact path="/LaMarque.js">
            <LaMarque />
          </Route>
          <Route exact path="/LaCollection.js">
            <LaCollection />
          </Route>
          <Route exact path="/Histoire.js">
            <Histoire />
          </Route>
        </BrowserRouter>
      </div>
    </div>

    // <BrowserRouter>
    //   <Enlaces />
